import React from 'react'
import { Navbar } from 'react-bootstrap'

const Header = () => {
  return (
    <div>
      <Navbar bg='dark' variant='dark'>
        <Navbar.Brand href='#home'>SbK</Navbar.Brand>
      </Navbar>
    </div>
  )
}

export default Header
